import React from 'react';
import { MDBIcon, MDBBtn} from 'mdbreact';
import "./Header.css"

function Header () {
    return (
        <div className= "header">
            <MDBBtn className= "icons" color= "rgba(0, 0, 0, 0.822)" idname= "gradIcon"><MDBIcon icon="graduation-cap" className= "logo" /></MDBBtn>
            <MDBBtn  color= "rgba(0, 0, 0, 0.822)"  className= "icons"><MDBIcon far icon="user" /></MDBBtn>
            <MDBBtn  color= "rgba(0, 0, 0, 0.822)" className= "icons"><MDBIcon far icon="comments" /></MDBBtn>

        </div>
    );
}

export default Header;
